The passion project I’ve been working on for a long time is finally here. My new show ABBY’S PLACES premieres this WEDNESDAY JULY 7 ON ESPN+.

I don’t do anything without passion and intention. I made this show for you to dive into the history, the history makers, and never-told magic of The Beautiful Game. 

Beyond the fact that Soccer is the game the World loves most, I wanted to show the World that Soccer Is Love. 

Sometimes that love looks like the near-violent passion of Liverpool and Man United loyalists; 
Sometimes it looks like brief civil war ceasefires in Kinshasa and Nigeria to witness Pele’s magic;
Sometimes it looks like the women of Colombia struggling with no resources, and less than $20 a day, but delivering excellence just for love of the game; and
Sometimes it looks like Landon Donovan leading his entire team to take a knee forfeiting a playoff-qualifying game in solidarity with the dignity of their gay teammate. 

Soccer is the great global unifier because Soccer is Love: messy, riotous, global passion. 

I loved making this show, and I hope I did justice to the game that has given the world so much. Please check out Abby's Places on Wed. 7/7 on ESPN+.

